import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import SpecialtyGrid from './SpecialtyGrid';
import BaselineChart from './BaselineChart';

const SpecialtySection = styled.div`
  padding: 50px 40px;
  border-bottom: 1px solid #e2e8f0;
  position: relative;
`;

const SectionHeader = styled.div`
  display: flex;
  align-items: center;
  margin-bottom: 35px;
  padding-bottom: 20px;
  border-bottom: 3px solid #1e3a8a;
  width: 100%;
`;

const SectionIcon = styled.div`
  width: 40px;
  height: 40px;
  background: #1e3a8a;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
  font-size: 1.2rem;
  margin-right: 15px;
`;

const SectionTitle = styled.h2`
  font-family: 'Merriweather', serif;
  font-size: 1.6rem;
  font-weight: 700;
  color: #1e3a8a;
  margin: 0;
`;

const SpecialtyAnalysis = () => {
  return (
    <SpecialtySection>
      <SectionHeader>
        <SectionIcon>üë©‚Äç‚öïÔ∏è</SectionIcon>
        <SectionTitle>Specialty-Specific Patterns</SectionTitle>
      </SectionHeader>

      <motion.div
        initial={{ opacity: 0, y: 30 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8, delay: 0.2 }}
      >
        <SpecialtyGrid />
        <BaselineChart />
      </motion.div>
    </SpecialtySection>
  );
};

export default SpecialtyAnalysis;
